INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(279384, 'itIT', 'Gara di Demolizioni del Capofondo', 'Gara di Demolizioni del Capofondo', 59888),
(279845, 'itIT', 'No...', '', 59888),
(275804, 'itIT', 'Hai idea di quanto costi quell\'affare? Mi rifarò sulla tua pellaccia verde, Sparachiodi!', '', 59888),
(268880, 'itIT', 'Vedere il mio Capitano che cerca di fare la cosa giusta, e che rinuncia al bottino offerto da Gallywix, mi fa infervorare!', '', 59888),
(271175, 'itIT', '', 'Ma mi stavo divertendo...', 59888),
(271159, 'itIT', '', 'Il mio Pacchetto Esecutivo! Voi... Vi ridurrò come ho ridotto il vostro amico Renzik!', 59888),
(268888, 'itIT', 'Questo è il Sangue Nero di capo Gallywix!', '', 59888),
(268887, 'itIT', 'Vi liberiamo subito dal vostro carico!', '', 59888),
(275706, 'itIT', 'Che ossa tremolanti!', '', 59888),
(275703, 'itIT', 'Quanto si scalda la carne prima di sfrigolare?', '', 59888),
(275100, 'itIT', 'Tocca a me! Li ridurrò in polvere.', '', 59888),
(275029, 'itIT', 'Vi farò a pezzi!', '', 59888),
(274595, 'itIT', 'Tanti soldi, grandi premi!', '', 59888),
(275947, 'itIT', 'Sono l\'ultimo boss che vedrete.', '', 59888),
(275944, 'itIT', 'Siete in DEBITO con me, babbei!', '', 59888),
(275943, 'itIT', 'Ehi! Venite qui!', '', 59888),
(282252, 'itIT', 'È Sfrecciacarro, vostro onore. Avvocato Sfrecciacarro.', '', 59888),
(282250, 'itIT', 'È vero, vostro onore. E se posso permettermi, credo che la storia di questa legge sia rilevante nel contesto attuale...', '', 59888),
(282246, 'itIT', 'Vostro onore, il Gallagio, in realtà, ha un proprietario.', '', 59888),
(282244, 'itIT', 'È semplice, vostro onore. Il proprietario è morto. Dev\'essere NECESSARIAMENTE messo sulla nostra rispettabilissima Casa d\'Aste!', '', 59888),
(281492, 'itIT', 'E Marty Sfrecciacarro è pronto. È tutto, vostro onore.', '', 59888),
(281491, 'itIT', 'Tarbonara Levafrizza è pronto, disponibile e rispettosamente umile, vostro onore.', '', 59888),
(276966, 'itIT', 'Ha anche piazzato dei granchi bomba attorno al tribunale, vostro onore. $p li ha disinnescati.', '', 59888),
(276963, 'itIT', 'Vostro onore, è ovvio! L\'assassino non può essere che... $p!', '', 59888),
(276962, 'itIT', 'Vostro onore. Abbiamo le prove per dimostrare che l\'assassino di Rosebud Gallywix è presente in quest\'aula oggi!', '', 59888),
(280948, 'itIT', '', 'Vuoi qualcosa? Che ne dici di un Torq Tascabile? È il miglior souvenir che il denaro possa comprare! E non può nemmeno schiacciare le persone o le piccole imprese! \n\n... Sì, è stato un problema in passato...', 59888),
(280946, 'itIT', 'Sto ancora cercando di risolvere i problemi: tutta questa rivoluzione mi fa sentire un po\' agitato.\n\nVuoi provare il Sollevafaccia di De Sfaccettis? Non ti rimette a nuovo, ti rimette al mondo!', '', 59888),
(280940, 'itIT', 'Bene, bene, bene... Vuoi partecipare alla mia operazione? Mi dispiace, nessuno rimane mai soddisfatto con un solo pezzo. Accumula un altro po\' di soldi e forse potrai fare affari con uno come me.', '', 59888),
(280939, 'itIT', 'La reception ha appena chiamato il capo, che ha detto che tu e i tuoi amici potete andare avanti. Sempre che abbiate abbastanza esperienza. Facciamo così: dimostratemi che avete le carte in regola per far fuori Mug\'zee e io vi faccio entrare a razzo sul retro.\n\nLa tua fedeltà significa molto per noi del Gallagio. *Anche se* vuoi mettere a soqquadro tutto!', '', 59888),
(280933, 'itIT', 'Il capo dice che non devo dire agli estranei che abbiamo armi contraffatte, cioè che non sono vere, così è più facile venderle ai turisti facendogli credere che siano vere.\n\nQuindi non dirlo a nessuno. *Specialmente* agli estranei.', '', 59888),
(280080, 'itIT', '<urla in preda alla rabbia>', '', 59888),
(279822, 'itIT', '', 'Ci becchiamo dopo, Gazzy.', 59888),
(275813, 'itIT', 'Qualcuno si sta innervosendo. Volete spodestarmi? Proseguite. Ci vedremo presto.', '', 59888),
(275810, 'itIT', 'E voi non avete il permesso! Non è così, Mug?', '', 59888),
(275777, 'itIT', 'Eureka! Gallywix iiiiiimpazzirà quando lo vedrà! Se lo vedrà... Uhm. Forse dovremmo fare prima qualche indagine di mercato.', '', 59888),
(275363, 'itIT', '', 'E anche questa è fatta!', 59888),
(275239, 'itIT', 'Torneremo subito dopo questi uhm... messaggi!', '', 59888);
