(2640, 'itIT', 'Calderone del Massacro', 'Il corso della storia ha visto molte guerre epiche, ma nessuna è stata più esplosiva della rivalità tra il gorilla galvanico Torq la Tempesta e il meccasauro magmatico Motorendo il Furioso. Questa sera, tutto potrà succedere quando questi due campioni si scontreranno nel calderone in una prova di forza che minaccia di spaccare in due Cavafonda! Non perdetevi il massacro se non volete essere la vergogna di tutti i Goblin.', 59888);
