(30331, 'itIT', 'Sommario', 'Motorendo e Torq danno spettacolo per il pubblico, lanciando |cFF2959D3|Hspell:473650|h[Scartobombe]|h|r e affliggendo i combattenti nell\'arena con |cFF2959D3|Hspell:473951|h[Carica Statica]|h|r.\nAl raggiungimento di 100 energia, Motorendo e Torq convergono entrambi in uno |cFF2959D3|Hspell:465833|h[Scontro Colossale]|h|r!', 59888),
(27555, 'itIT', 'Guaritori', '$bullet;Al termine, |cFF2959D3|Hspell:424739|h[Corruzione Caotica]|h|r erutta e si diffonde sul personaggio più vicino.\n$bullet;|cFF2959D3|Hspell:424739|h[Corruzione Caotica]|h|r infligge moderati danni periodici al bersaglio attuale.\n$bullet;|cFF2959D3|Hspell:425052|h[Gravità Oscura]|h|r infligge moderati danni a tutti i personaggi per tutta la sua durata.', 59888),
(30489, 'itIT', 'Assaltatori', '$bullet;Il |cFF2959D3|Hspell:465952|h[Mucchio di Bombe Grosse e Cattive]|h|r e l\'|cFF2959D3|Hspell:1214607|h[Esplosione di Bombe Più Grosse e Più Cattive]|h|r attivano anche |cFF2959D3|Hspell:466158|h[Borsa del Geniere]|h|r e |cFF2959D3|Hspell:1214755|h[Razzi Sovraccarichi]|h|r.\n$bullet;I Tecnici dei Micciascura morenti rilasciano delle Bombe Giganti che fanno un |cFF2959D3|Hspell:1223905|h[BOOM Gigante!]|h|r dopo $1223905D. La |cFF2959D3|Hspell:469327|h[Detonazione Gigante]|h|r di Gallywix le fa esplodere istantaneamente.\n$bullet;Le |cFF2959D3|Hspell:469362|h[Bombe Giganti Cariche]|h|r portate ai Comandi Giganti attivano una |cFF2959D3|Hspell:469767|h[Detonazione Bomba Gigante]|h|r, provocando un |cFF2959D3|Hspell:1220846|h[Collasso dei Comandi]|h|r che interrompe le |cFF2959D3|Hspell:469286|h[Bobine Giganti]|h|r di Gallywix.\n$[15,16$bullet;Se lasciata incontrollata, la Sentinella Tirolesto può infliggere ingenti danni con |cFF2959D3|Hspell:466834|h[Raffica Folgorante]|h|r.$]', 59888),
(30488, 'itIT', 'Guaritori', '$bullet;I personaggi affetti dai |cFF2959D3|Hspell:1220761|h[Recipienti del Mecchingegnere]|h|r esplodono al consumo o al termine, provocando |cFF2959D3|Hspell:474447|h[Detonazione del Recipiente]|h|r.\n$bullet;I Tecnici dei Micciascura morenti rilasciano delle Bombe Giganti che fanno un |cFF2959D3|Hspell:1223905|h[BOOM Gigante!]|h|r dopo $1223905D. La |cFF2959D3|Hspell:469327|h[Detonazione Gigante]|h|r di Gallywix le fa esplodere istantaneamente.\n$bullet;Le |cFF2959D3|Hspell:469362|h[Bombe Giganti Cariche]|h|r portate ai Comandi Giganti attivano una |cFF2959D3|Hspell:469767|h[Detonazione Bomba Gigante]|h|r, provocando un |cFF2959D3|Hspell:1220846|h[Collasso dei Comandi]|h|r che interrompe le |cFF2959D3|Hspell:469286|h[Bobine Giganti]|h|r di Gallywix.\n$bullet;Le |cFF2959D3|Hspell:469286|h[Bobine Giganti]|h|r, il |cFF2959D3|Hspell:466338|h[Razzo a Zig-Zag]|h|r e |cFF2959D3|Hspell:1214369|h[DISTRUZIONE TOTALE!!!]|h|r infliggono ingenti danni.', 59888),
(30487, 'itIT', 'Difensori', '$[15,16$bullet;Il |cFF2959D3|Hspell:465952|h[Mucchio di Bombe Grosse e Cattive]|h|r e l\'|cFF2959D3|Hspell:1214607|h[Esplosione di Bombe Più Grosse e Più Cattive]|h|r creano anche una |cFF2959D3|Hspell:466165|h[Bomba \"Inesplosa\" da 1500 Kg]|h|r.$]\n$bullet;I |cFF2959D3|Hspell:466340|h[Recipienti a Frammentazione]|h|r e l\'|cFF2959D3|Hspell:1214607|h[Esplosione di Bombe Più Grosse e Più Cattive]|h|r affliggono i personaggi di fronte a Gallywix.\n$bullet;I Tecnici dei Micciascura morenti rilasciano delle Bombe Giganti che fanno un |cFF2959D3|Hspell:1223905|h[BOOM Gigante!]|h|r dopo $1223905D. La |cFF2959D3|Hspell:469327|h[Detonazione Gigante]|h|r di Gallywix le fa esplodere istantaneamente.\n$bullet;Quando raggiunge $1220290s2 accumuli o quando cambia il bersaglio primario, Gallywix rilascia tutti i |cFF2959D3|Hspell:1220290|h[Tiri Ingannevoli]|h|r.', 59888),
