(31173, 'itIT', 'Intermezzo: Agganciato e caricato', 'Gallywix atterra nell\'arena infliggendo |cFF2959D3|Hspell:1214226|h[Craterizzazione]|h|r a chiunque si trovi sulla sua strada, ottenendo |cFF2959D3|Hspell:1214229|h[Rivestimento di Classe Armageddon]|h|r, quindi lancia |cFF2959D3|Hspell:1214369|h[Distruzione Totale!!!]|h|r finché non viene interrotto.', 59888),
