(30498, 'itIT', 'Fase 1: Che arsenale!', '\"Di certo non si ottiene il proprio volto scolpito su una montagna lasciandosi comandare a bacchetta dagli altri!\"\n\nGallywix colpisce i nemici con il suo arsenale potenziato.', 59888),
