(31956, 'itIT', 'Assaltatori', '$bullet;Le |cFF2959D3|Hspell:468846|h[Scintille Balzanti]|h|r inseguono i personaggi e li stordiscono al contatto.\n$bullet;L\'|cFF2959D3|Hspell:465279|h[Acqua della Diga]|h|r si elettrifica al contatto con le abilità fulminanti di Geezle.\n$bullet;|cFF2959D3|Hspell:465463|h[Turbocarica]|h|r e |cFF2959D3|Hspell:468813|h[Gigascossa]|h|r infliggono ingenti danni.', 59888),
(31102, 'itIT', 'Difensori', '$bullet;Rik fa |cFF2959D3|Hspell:466128|h[risuonare]|h|r della potenza aggiuntiva verso gli amplificatori vicini.\n$bullet;|cFF2959D3|Hspell:464488|h[Esplosione Sonica]|h|r infligge danni sonici in un cono frontale e applica |cFF2959D3|Hspell:464518|h[Tinnito]|h|r. I danni sonici non possono essere bloccati o ridotti dall\'armatura.\n$bullet;L\'|cFF2959D3|Hspell:466722|h[Esplosione]|h|r dell\'amplificatore scaglia in aria i personaggi mentre Rik genera |cFF2959D3|Hspell:467991|h[Discese Assordanti]|h|r letali.', 59888),
(30506, 'itIT', 'Difensori', '$bullet;|cFF2959D3|Hspell:466518|hLe [Nocche d\'Oro Fuso]|h|r infliggono ingenti danni di fronte a Mug e applicano |cFF2959D3|Hspell:467202|h[Goccia Dorata]|h|r ai personaggi colpiti.\n$bullet;I danni inflitti da |cFF2959D3|Hspell:469490|h[Doppio Colpo]|h|r vengono mitigati dal personaggio più vicino colpito.', 59888),
(30486, 'itIT', 'Sommario', 'Gallywix accumula energia nel tempo, attivando le |cFF2959D3|Hspell:469286|h[Bobine Giganti]|h|r della Casa del Cromo al massimo della sua potenza. Le |cFF2959D3|Hspell:469362|h[Bombe Giganti Cariche]|h|r portate ai Comandi Giganti attivano una |cFF2959D3|Hspell:469767|h[Detonazione Bomba Gigante]|h|r. Ciò provoca un |cFF2959D3|Hspell:1220846|h[Collasso dei Comandi]|h|r che interrompe le |cFF2959D3|Hspell:469286|h[Bobine Giganti]|h|r di Gallywix. Quando si perdono entrambi i Comandi Giganti, si forma una |cFF2959D3|Hspell:1215209|h[Zona di Sabotaggio]|h|r.\n\nInoltre, per tutto lo scontro Gallywix richiama i Soci Micciascura più strapagati in aiuto.\n\nFinché la battaglia infuria, Gallywix prepara e potenzia il suo arsenale, scatenando un caos folle.$[14,15,17$ Quando raggiunge il 50% di salute restante, Gallywix potenzia le proprie capacità per eliminare i personaggi una volta per tutte. $]', 59888),
(30082, 'itIT', 'Guaritori', '$bullet;Se non vengono depositati due gettoni o viene rilevata una combinazione ripetuta durante |cFF2959D3|Hspell:461060|h[Gira per Vincere!]|h|r, il Bandito con un Braccio Solo usa |cFF2959D3|Hspell:461068|h[Frode Rilevata!]|h|r.\n$bullet;|cFF2959D3|Hspell:460164|h[Scarico Sudicio]|h|r riduce la velocità di movimento di tutti i personaggi e assorbe una grande quantità di cure.\n$bullet;Stare vicino alla |cFF2959D3|Hspell:460181|h[Linea Vincente]|h|r fornisce |cFF2959D3|Hspell:460444|h[Giocatore Incallito!]|h|r.', 59888),
(31381, 'itIT', 'Sezione 45', '', 59888),
(31380, 'itIT', 'Sezione 44', '', 59888),
(30951, 'itIT', 'Guaritori', '$bullet;Le Bombe a Tempo Ticchettanti create da |cFF2959D3|Hspell:460867|h[Bel Bada BUM!]|h|r infliggono ingenti danni a tutti i personaggi, se lasciate esplodere.\n$bullet;|cFF2959D3|Hspell:459779|h[Carica Irruente]|h|r permette a Bront di attraversare gli oggetti sulla sua traiettoria, incluse le Bombe a Tempo Ticchettanti create da |cFF2959D3|Hspell:460867|h[Bel Bada BUM!]|h|r.\n$bullet;$[8,23Se dissolto, il |cFF2959D3|Hspell:473690|h[Gel Esplosivo Cinetico]|h|r scaglia in aria le Bombe a Tempo Ticchettanti.$]', 59888),
(30950, 'itIT', 'Difensori', '$bullet;Le Bombe a Tempo Ticchettanti create da |cFF2959D3|Hspell:460867|h[Bel Bada BUM!]|h|r infliggono ingenti danni a tutti i personaggi, se lasciate esplodere.\n$bullet;|cFF2959D3|Hspell:459779|h[Carica Irruente]|h|r permette a Bront di attraversare gli oggetti sulla sua traiettoria, incluse le Bombe a Tempo Ticchettanti create da |cFF2959D3|Hspell:460867|h[Bel Bada BUM!]|h|r.', 59888),
(30949, 'itIT', 'Assaltatori', '$bullet;Le Bombe a Tempo Ticchettanti create da |cFF2959D3|Hspell:460867|h[Bel Bada BUM!]|h|r infliggono ingenti danni a tutti i personaggi, se lasciate esplodere.\n$bullet;|cFF2959D3|Hspell:459779|h[Carica Irruente]|h|r permette a Bront di attraversare gli oggetti sulla sua traiettoria, incluse le Bombe a Tempo Ticchettanti create da |cFF2959D3|Hspell:460867|h[Bel Bada BUM!]|h|r.\n$bullet;$[8,23Se dissolto, il |cFF2959D3|Hspell:473690|h[Gel Esplosivo Cinetico]|h|r scaglia in aria le Bombe a Tempo Ticchettanti.$]', 59888),
