(31132, 'itIT', 'Assaltatori', '$bullet;Kul\'tharok strappa le anime dai personaggi con |cFF2959D3|Hspell:473959|h[Trazione dell\'Anima]|h|r. Se le anime raggiungono Kul\'tharok, lui le infonde con l\'energia necrotica, provocando |cFF2959D3|Hspell:474013|h[Corruzione dell\'Anima]|h|r.\n$bullet;|cFF2959D3|Hspell:1216474|h[Spirale di Morte]|h|r crea un globo rotante di negromanzia che infligge danni da ombra ai personaggi con cui entra in contatto.', 59888),
(28414, 'itIT', 'Sommario', 'Il Maestro dell\'Idromele Aldryr sfrutta il potere esplosivo dell\'Idromele Cinereo, assaltando i personaggi con |cFF2959D3|Hspell:432198|h[Rutto Fiammeggiante]|h|r e |cFF2959D3|Hspell:432182|h[Lancio Idromele Cinereo]|h|r.\n\nQuando raggiunge il 66% e il 33% di salute restante, il Maestro dell\'Idromele Aldryr inizia a lanciare |cFF2959D3|Hspell:442525|h[Aperitivo]|h|r e fa sì che i Clienti Assetati scatenino un |cFF2959D3|Hspell:431896|h[Urlo Turbolento]|h|r.', 59888),
(22652, 'itIT', 'Assaltatori', '$bullet;|cFF2959D3|Hspell:333292|h[Morte Ardente]|h|r infligge danni agli alleati vicini.\n$bullet;Quando raggiunge 100 energia, Paceran colpisce i personaggi con |cFF2959D3|Hspell:320182|h[Spore Nocive]|h|r.', 59888),
(22650, 'itIT', 'Difensori', '$bullet;|cFF2959D3|Hspell:320069|h[Assalto Mortale]|h|r riduce tutte le cure ricevute.\n$bullet;Quando raggiunge 100 energia, Paceran colpisce i personaggi con |cFF2959D3|Hspell:320182|h[Spore Nocive]|h|r.', 59888),
