(21580, 'itIT', 'Assaltatori', '$bullet;Quando uno sfidante viene sconfitto, fornisce agli sfidanti restanti |cFF2959D3|Hspell:1215747|h[Ultime Volontà]|h|r.\n$bullet;|cFF2959D3|Hspell:333292|h[Morte Ardente]|h|r infligge danni agli alleati vicini.\n$bullet;Quando raggiunge 100 energia, Paceran colpisce i personaggi con |cFF2959D3|Hspell:320182|h[Spore Nocive]|h|r.', 59888),
(21579, 'itIT', 'Guaritori', '$bullet;|cFF2959D3|Hspell:320069|h[Assalto Mortale]|h|r riduce tutte le cure ricevute.\n$bullet;|cFF2959D3|Hspell:333292|h[Morte Ardente]|h|r infligge danni agli alleati vicini.\n$bullet;|cFF2959D3|Hspell:1215600|h[Tocco Avvizzente]|h|r infligge danni da ombra continui ai personaggi bersaglio finché non viene dissolto.', 59888),
(21577, 'itIT', 'Sommario', 'Sconfiggere tutti e tre gli sfidanti per dimostrare il proprio valore. Quando raggiunge il 100% di energia, ogni sfidante scatena un\'abilità unica.', 59888),
(19233, 'itIT', 'Difensori', '$bullet;Portare il Flagellatore Platinato a portata dei |cFF2959D3|Hspell:282943|h[Fracassatori]|h|r per dissolvere gli accumuli di |cFF2959D3|Hspell:282801|h[Placcatura in Platino]|h|r.', 59888);
