INSERT INTO `mount_locale` (`ID`, `locale`, `Name_lang`, `SourceText_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(2345, 'itIT', 'Pelditè Meeksi', '|cFFFFD200Negozio di gioco|r|n', 'I pelditè sono famosi per i loro tè aromatici. Tuttavia, la loro natura giocosa rischia di far rovesciare un po\' troppo tè.', 59888),
(2344, 'itIT', 'Ruzzolazampa Meeksi', '|cFFFFD200Negozio di gioco|r|n', 'I ruzzolazampa sono molto orgogliosi del proprio lavoro come portatori di tè e sono sempre felici di offrire una tazza di tè caldo ai compagni di viaggio.', 59888),
(2343, 'itIT', 'Zampamolle Meeksi', '|cFFFFD200Negozio di gioco|r|n', 'Gli zampamolle servono un tè nero ideale per svegliarsi la mattina presto o per rimanere svegli fino a tarda notte.', 59888),
(2342, 'itIT', 'Arruffapelo Meeksi', '|cFFFFD200Negozio di gioco|r|n', 'Gli arruffapelo sono giocosi, maldestri e ossessionati dalla pulizia. Una combinazione di caratteristiche piuttosto pericolosa.', 59888),
(2489, 'itIT', 'Farfalla Perlescente', '|cFFFFD200Emporio|r', 'Solca i cieli con una farfalla scintillante e perlescente.', 59888),
(2288, 'itIT', 'S.C.A.R.T.O.M.A.N.T.E. Personalizzato dei Goblin', '|cFFFFD200Bottino:|r Mucchio di Scarti Vagliato|n|cFFFFD200Zona:|r Cavafonda', 'I Segatronchi dei Goblin hanno dimostrato più volte di essere utili in molte applicazioni, ad esempio nel settore del taglio e del trasporto. Questo modello è stato riadattato per essere utilizzato con lo S.C.A.R.T.O.', 59888),
(2346, 'itIT', 'Rubabirra Meeksi', '|cFFFFD200Negozio di gioco|r|n', 'Nonostante la natura dispettosa e giocosa, queste creature sono compagne di viaggio fedeli e affidabili.', 59888),
(2296, 'itIT', 'Giramondo Goblin delle Scorribande', '|cFFFFD200Missione mondiale: |rRivoglio il mio cappello!|n|cFFFFD200Zona: |rIsola di Dorn|n|cFFFFD200Zona: |rDornogal', 'Questo velivolo ti aiuterà a tuffarti dritto all\'avventura, se non esplode prima!', 59888),
(2279, 'itIT', 'Razzo Cilecca Tonante', '|cFFFFD200Mercante: |rAndo Rivoltella|n|cFFFFD200Zona: |rLiberazione di Cavafonda|n|cFFFFD200Costo: |r500|TINTERFACE\\MONEYFRAME\\UI-GOLDICON.BLP:0|t', 'Recuperato dalle gradinate del Calderone durante uno scontro particolarmente cruento. Quando gli è stato chiesto se si trattasse di un oggetto difettoso, l\'operatore di Torq ha risposto solo: \"Probabilmente?\".', 59888),
(2276, 'itIT', 'Sgranocchiatore dei Micciascura', '|cFFFFD200Mercante: |rAndo Rivoltella|n|cFFFFD200Zona: |rLiberazione di Cavafonda|n|cFFFFD200Costo: |r500|TINTERFACE\\MONEYFRAME\\UI-GOLDICON.BLP:0|t', 'Considerato il migliore degli esemplari tra le Iene di Discarica di Stix, la forza del suo morso  è sufficiente a schiacciare qualsiasi cosa, o persona, Gallywix voglia eliminare.', 59888),
(1471, 'itIT', 'Vendetta', '|cFFFFD200Bottino:|r Dama Sylvanas Ventolesto|n|cFFFFD200Zona:|r Sanctum del Dominio|n|cFFFFD200Difficoltà:|r Mitica', 'Il giorno in cui Arthas le tolse la vita, Sylvanas perse una parte di sé e l\'oscurità crebbe in lei colmandone il vuoto.', 59888);
